import React from "react";

function PokeList({ pokemon }) {
    const pokeURL = `https://pokeapi.co/api/v2/pokemon/${pokemon.results.name}`;
    console.log(pokeURL);
    return (
        <div className="container">
            {pokemon.map(p => (
                <div>
                    <div className="poke-div" key={p.name}>
                        {p.name} 
                    </div>

                </div>
            ))}
        </div>
    )

}

export default PokeList;
